			return false
		}
		if (parseInt(inpStocktakeCount.text) == 0) {
			return false
		}
		if (tabMaterialSelect.selectedTab == "") {
			if (selectStockedMaterial.selectedOptionValue == "") {
				return false
			}
		} else {
			if (selectUnstockedMaterial.selectedOptionValue == "") {
				return false
			}
		}
	}

